@Tùng Tu:chúa Giê-su chỉ là con của " thiên chúa "
Thiên Chúa phái con ngài là Đấng "Mê si" xuống đầu thai vào trinh nữ " Maria " và được đặt tên là "Giê-su" Chúa giê - su sinh vào năm 6TCN - 4TCN không cụ thể đc
" Thiên Chúa " Mới tạo ra vạn vật " Vũ Trụ Này , chứ không phải giê - su 🥰

